import React, { useState } from "react";
import { Navbar, Nav, NavDropdown, NavbarBrand, Alert } from "react-bootstrap";

import { useAuth } from "../../firebase/context";

import logo from "../../assets/jmlogo.png";
import "../../App.css";
import { useHistory, Link } from "react-router-dom";

const TopNavBar = () => {
  const history = useHistory();
  const { logout, currentUser } = useAuth();
  const [error, setError] = useState("");

  async function handleLogout(e) {
    e.preventDefault();
    setError("");

    try {
      await logout();
      history.push("/login");
    } catch {
      setError("Failed to log out");
    }
  }

  return (
    <Navbar collapseOnSelect expand="lg" bg="transparent" variant="light">
      <NavbarBrand as={Link} to="/">
        <img width={100} height={100} alt="style by jm logo" src={logo} />
      </NavbarBrand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />

      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav
          className="mx-auto"
          activeKey="#mens"
        >
          <Nav.Link as={Link} to="/mens" href="#mens">
            Mens
          </Nav.Link>
          <Nav.Link as={Link} to="/bags" href="#womens">Womens</Nav.Link>
          <NavDropdown title="Accessories" id="collasible-nav-dropdown">
            <NavDropdown.Item as={Link} to="/accessories" href="#action/shoecare">
              Shoe Care
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/laces">Laces</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.4">Shoe Inserts</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.5">
              Cream & Polish
            </NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href="#byrequest">By Request</Nav.Link>
          <Nav.Link eventKey={2} href="#aboutus">
            Heritage
          </Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link>Cart</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNavBar;
